(8, 4, 0, 0, 7, 0, 'Task', 'Normal', 'Done', 'Internet TDN Duri Kosambi Mati', '<p>Jaringan internet Iforte tdn duri kosambi mati, sudah ditangani dan sudah up kembali menggunakan backup internet indihome. internet down dari jam 07.50 - 09.00, saat ini jalur internet iforte sedang ditangani oleh pihak iforte dan sampai menunggu update laporan jalur internet iforte up kembali.</p><p><img src=\"data:image/png;base64,\" data-filename=\"TDN KOSMABI.PNG\" style=\"width: 708px;\"><br></p>', '2025-05-19', 0, '2025-05-19 02:02:53');
INSERT INTO `issues` (`id`, `clientid`, `assetid`, `projectid`, `adminid`, `milestoneid`, `issuetype`, `priority`, `status`, `name`, `description`, `duedate`, `timespent`, `dateadded`) VALUES
(9, 3, 0, 2, 6, 0, 'Maintenance', 'Normal', 'Done', 'Replace HDD ke SSD - PC Jiwo', '<ol><li>Install windows 10 di SSD (Kapasitas 500GB)</li><li>Backup data dari HDD existing (Kapasitas 1TB)</li><li>Install aplikasi standar, seperti : Office 2021, Chrome, Accurate Desktop dan Adobe Reader.</li><li>DHCP</li><li>Install uniflow client.</li><li>Replace RAM, existing 8GB+4GB, menjadi 8GB+8GB</li></ol>', '2025-05-18', 0, '2025-05-19 03:19:09'),
(10, 3, 0, 2, 6, 0, 'Maintenance', 'Normal', 'Done', 'Replace HDD ke SSD - PC Refiana', '<ol><li>Install windows 10 di SSD (Kapasitas 500GB)</li><li>Backup data dari HDD existing (Kapasitas 1TB)</li><li>Install aplikasi standar, seperti : Office 2021, Chrome, Accurate Desktop dan Adobe Reader.</li><li>DHCP</li><li>Install uniflow client.</li><li>Replace RAM, existing 4GB+4GB, menjadi 8GB+8GB</li></ol>', '2025-05-18', 0, '2025-05-19 03:23:00'),
(11, 3, 0, 3, 3, 0, 'Task', 'Normal', 'In Progress', 'Integrasi iRetail, AOL dan Accurate Offline ke Superset', '<p>Status </p><p>- iRetail integrasi superset 80%</p><p>- AOL integrasi Superset ( sample data manualy by csv 70% )</p><p>- AOF SNJ integrasi Superset ( Sample data manualy by csv 0% )</p><p>- ESB intergasi Superset ( Sample data manualy by csv 0% )</p><p>- AOF GFI intergasi Superset ( Sample data manualy by csv 0% )</p>', '2025-06-30', 0, '2025-05-19 03:51:21'),
(12, 3, 0, 3, 3, 0, 'Task', 'Normal', 'In Progress', 'Integrasi AOF SNJ ke sistem PLB', '<p>Integrasi (sampel data AOF SNJ ke PLB 0%)</p>', '2025-06-30', 0, '2025-05-19 03:52:36'),
(13, 3, 0, 3, 3, 0, 'Task', 'Normal', 'In Progress', 'Compile AOL SNJ (grosir) menjadi 1 Database', '<p>Database trial sudah di buat dan sudah trail untuk transaksi dan department oleh Pak Agung.</p><p>Tinggal nunggu final master data untuk upload ke DB collect SNJ Grosir</p>', '2025-06-30', 0, '2025-05-19 03:54:18'),
(14, 3, 0, 3, 3, 0, 'Task', 'Normal', 'Done', 'Pembuatan Database AOL Soepomo Tebet Grosir', '<p>Sudah dibuat databse AOL untuk grosir Soepomo Tebet</p>', '2025-05-19', 0, '2025-05-19 05:10:39'),
(15, 3, 0, 0, 3, 0, 'Task', 'Normal', 'Done', 'Connect PC User ke server Printer', '<p>kenksi dari PC indah NR ke server printer Yusana NR</p>', '2025-05-19', 0, '2025-05-19 06:29:21'),
(53, 8, 0, 17, 3, 0, 'Task', 'Normal', 'Done', 'Hapus penerimaan penjualan', '<p>Hapus penerimaan penjualan karana salah input</p><p>an a.n minar 103.2025.05.00545</p>', '2025-05-26', 0, '2025-05-26 03:27:11');
