(26, 5, 0, 0, 7, 0, 'Task', 'Normal', 'Done', 'Trouble POE Lt 3 Office Soepomo', '<p>Switch POE lantai 3 Office Soepomo terkendala POE tidak terdeteksi (error), sudah di cek jalur kabel dan restart unit masih error, solusinya mengganti perangkat POE dengan yang baru.</p><p><img src=\"data:image/png;base64,\" data-filename=\"poe lt3.PNG\" style=\"width: 708px;\"><br></p>', '2025-05-20', 0, '2025-05-20 01:25:29');
