INSERT INTO `issues` (`id`, `clientid`, `assetid`, `projectid`, `adminid`, `milestoneid`, `issuetype`, `priority`, `status`, `name`, `description`, `duedate`, `timespent`, `dateadded`) VALUES
(28, 3, 0, 8, 3, 0, 'Task', 'High', 'Done', 'AOL error report detail penjualan', '<p>Error terjadi karena ada rumus deviden yang pembaginya 0. Error nya seperti gambar di bawah</p><p><br></p><p><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 466.159px; height: 122.644px;\"></p><p>Caranya edit rumus :</p><p><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 457.306px; height: 287.431px;\"></p><p><br></p><p>Tambahkan kode&nbsp;<b>,6, RoundingMode.DOWN) </b>dibelakang rumus pembaginya. sehingga rumus komplitnya dari</p><p><b>$F{salesInvoiceDetail.totalPrice}.divide($F{salesInvoiceDetail.quantity})</b></p><p>jadi</p><p><b>$F{salesInvoiceDetail.totalPrice}.divide($F{salesInvoiceDetail.quantity},6, RoundingMode.DOWN)</b></p><p><b><br></b></p><p><b>Klik OK sampai report nya keluar</b></p><p>Kemuadian Save memorize report tersebut.</p><p></p>', '2025-05-20', 0, '2025-05-20 03:16:31');
INSERT INTO `issues` (`id`, `clientid`, `assetid`, `projectid`, `adminid`, `milestoneid`, `issuetype`, `priority`, `status`, `name`, `description`, `duedate`, `timespent`, `dateadded`) VALUES
(29, 3, 0, 6, 5, 0, 'Task', 'Normal', 'Done', 'troubleshooting port LAN LT.4 Tebet', '<p>Prort LAN PC Happy dan Melly tidak bisa melakukan internet .<br><br>problem solving .<br>1. putus jalur LAN dengan Port LAN harus disambung dan di buat ulang</p><p><br><br><br></p>', '2025-05-20', 0, '2025-05-21 01:10:58'),
(30, 4, 0, 10, 5, 0, 'Task', 'Normal', 'Done', 'troubleshooting PC Tias NR', '<p>mengalami not responding baik saat print maupun saat save data karena terdapat dua OS microsoft office&nbsp;<br><br>problem solvingnya.</p><p>1. harus menghapus salah satu dari Office yang dipakai dan Restart ulang PC&nbsp;</p>', '2025-05-20', 0, '2025-05-21 01:13:34'),
(31, 4, 0, 12, 5, 0, 'Task', 'Low', 'Done', 'Perbaikan Printer TIM NR yusana ', 'Saat user melakukan Print dokumen maka apabila lebih dari 1 harus klik OK untuk terus ke halaman berikutnya<br><br>problem solving&nbsp;<br>1. maintenance Rolling kertas<br>2. kondisi Cardride Sudah hampir penuh dan harus diganti&nbsp;', '2025-05-20', 0, '2025-05-21 01:16:45'),
(32, 3, 4, 6, 5, 0, 'Task', 'Low', 'Done', 'Tidak mendapatkan jaringan Internet', '<p>dikarenakan kabel LAN Antara Port LAN dan Port LAN CPU tidak kencang&nbsp;<br><br>problem solvingnya&nbsp;<br>1. cukup di tekan antara port LAN dan POrt LAN CPU&nbsp;</p>', '2025-05-20', 0, '2025-05-21 01:20:22'),
(33, 4, 0, 0, 7, 0, 'Task', 'Normal', 'Done', 'Troubleshooting POS TDN Rawa Mangun', '<p>POS TDN Rawamangun Tidak terkonelsi dengan internat dan tidak bisa membuka iretail (aplikasi penjualan).<img src=\"data:image/jpeg;base64,\" style=\"width: 708px;\" data-filename=\"WhatsApp Image 2025-05-21 at 11.56.46_b138cb52.jpg\"></p>', '2025-05-21', 0, '2025-05-21 06:13:48'),
