(45, 7, 0, 0, 7, 0, 'Task', 'Normal', 'Done', 'Internet HQ Soepomo Biznet', '<p>Jalur internet Biznet : terjadi pemblokiran dari pihak portal nya beacukai (https://portal.beacukai.go.id/portal/login), dan sudah di reset ulang ip public nya biznet.</p>', '2025-05-24', 0, '2025-05-24 06:42:18'),
(46, 7, 0, 16, 6, 0, 'New Feature', 'Normal', 'In Progress', 'Collective data inventory di Accurate Online', '<ol><li>Explore API accurate via Google Meet&nbsp;</li><li>Memberikan akses Accurate Online - DEV-GROSIR-DEPOK ke Jashinta (Forstok)</li><li>Per Jumat&nbsp; 23 Mei 2025, Jashinta dan Team Backend akan explore API Accurate dan akan memberi estimasi timeline dalam beberapa hari ke depan.</li></ol>', '2025-06-30', 0, '2025-05-26 01:20:41'),
(47, 7, 0, 16, 3, 0, 'Task', 'Normal', 'In Progress', 'Superset - Integrasi iRetail to Big Query', '<p>- Progress 80%</p>', '2025-06-30', 0, '2025-05-26 01:52:02'),
(48, 3, 0, 4, 6, 0, 'Task', 'Normal', 'Done', 'Install Driver foto copy canon - Laptop Fahmi HRD', '<ol><li>Install driver foto copy canon</li><li>Membuat account uniflow menggunakan gmail.</li><li>Sharing knowledge cara print di Mesin Foto Copy Canon lantai 3</li></ol>', '2025-05-21', 0, '2025-05-26 01:56:43'),
(49, 3, 0, 4, 6, 0, 'Task', 'Normal', 'Done', 'Install Driver foto copy canon - PC Rangga HRD', '<ol><li>Install driver foto copy canon</li><li>Membuat account uniflow menggunakan gmail.</li><li>Sharing knowledge cara print di Mesin Foto Copy Canon lantai 3</li></ol>', '2025-05-21', 0, '2025-05-26 01:57:36'),
(50, 3, 0, 6, 6, 0, 'Task', 'Normal', 'Done', 'Troubleshoot Accruate Desktop ETT Penggilingan - PC Bu Ika', '<ol><li>Analisa permasalahan jaringan saat tidak bisa buak Laporan Neraca ETT via Wifi dan LAN.&nbsp;</li><li>Issue solve setelah user menggunakan hotspot pribadi.</li></ol>', '2025-05-23', 0, '2025-05-26 02:15:24'),
